==简介==
Gupooaraicon模板提供《[[少女与战车]]》大洗女子学园9支小队以及大洗自己的[[矢量图]]Logo。
==使用方法==
  <nowiki>{{Gupooaraicon}}</nowiki>
  <nowiki>{{Gupooaraicon|队伍名称（或关键字）|size=尺寸px（默认为25px，可不填）}}</nowiki>
  <nowiki>{{Gupooaraicon|size=尺寸px（默认为25px，可不填）}}</nowiki>
