==全部组队伍称及其标识==
所有队伍名称由[[模块:少女与战车:大洗队伍信息|少女与战车:大洗队伍信息]]模块生成，该模块会截取用户输入的关键字，从中取出有效关键字并生成组织名称，再由本模板进行解析后生成组织Logo。
以下为所有队伍全部名称一览，'''黑体字部分为模块获取的组织名称关键字，也是用户需要输入的最短的组织名称代码（英语不区分大小写），当用户输入这些关键字后，即便其输入的组织名称有细微的差别也不会影响模板识别用户输入的信息（比如不论用户输入“鮟鱇”还是“鮟鱇鱼”，都能得到一个鮟鱇队的Logo'''{{Gupooaraicon|鮟鱇鱼}}'''。）。'''

